  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130802 includes physical
  and profile data collected aboard NOAA Ship THOMAS JEFFERSON during project OPR-D304-TJ-05
  in the North Atlantic Ocean from 2005-06-02 to 2006-06-21. These data include SOUND
  VELOCITY. The instruments used to collect these data include CTD. These data were
  collected and submitted by the NOAA Office of Coast Survey in support of hydrographic
